import { NavLink } from 'react-router-dom';


const Message = (props) => {
	return (
		<p>{props.message}</p>
	);
}

const Messages = (props) => {
	return (
		<div>
			<h2>Чат</h2>
			<div>
				<Message message="lorem"/>
				<p>Lorem ipsum dolor sit amet.</p>
				<p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Modi, nobis mollitia?</p>
			</div>
		</div>
	);
}

export default Messages;
